import React, { Component } from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'


class App extends Component {
  constructor(props) {
    super(props)
    this.getList = this.getList.bind(this)
    this.state = {
      url: theUrl + '/commodityList' 
    }
  }

  componentDidMount() {
    this.getList(this.state.url)
  }

  getList = (getList) => {

    fetch(getList)
    .then(res => { return res.json() })
    .then(res => {
        this.props.init(res)
        // Debugging
        // console.log(res)
    })
    .catch(e=> {
        console.log(e)

    })
  }

  render() {
    return(
      <div>
        <div>
          <h1>Hello react</h1>
          <Link to="/user_profile">To user profile  || </Link>
          <Link to="/root_dashboard">To root dashboard  || </Link>
          <Link to="/admin_dashboard">To admin dashboard || </Link>
          <Link to="/signup">Sign up</Link>
        </div>

        <div>

        </div>
      </div>
    )
  }
}


const mapDispatchToProps = dispatch => ({
  init: res => dispatch({
    type: 'INIT',
    res
  })
})

export default connect(
  mapDispatchToProps
)(App);
